// pages/schema.js

import Layout from '../components/MyLayout';

export default function Schema() {
  return (
    <Layout>
        <h1>Collecton of Asset</h1> 
        <p>Think of a Collection of Asset as a box of toys, each asset as a toy</p>
        <br /> <hr /> <br />
    </Layout>
  );
}
